contract oddEve{
    uint public score;
    uint randomnumber;

    constructor()
    {
        score = 0;
        randomnumber=4;
    }
    
    /*function test() public view returns (string memory)
    {
        string memory a="fd";
        return a;
    }*/

    function takeinput(uint _inputnumber) public  returns (uint){
        if (_inputnumber<1 || _inputnumber >6){
            return 0;
        }
            
        else
        {
            //generate a randomnumber
            
            if (randomnumber==_inputnumber)
            {
                return _inputnumber;	//yet to implement

            }
            else
            {
                score = score + randomnumber;
                return _inputnumber;	//yet to implement
            }
        }
    }

    function reset() public  returns (string memory){
        score = 0;
        return "Game RESET";
    }

}

